import React, { Component } from 'react';
import Layout from '../../layout/Layout';
import Header from '../../../pageSettings/header/Header';
import LinkLayout from '../../layout/layoutLink/LinkLayout';

export default class AddCpuCooler extends Component {
  render() {
    return (
      <Layout>
        <Header h1Heading='Add Motherboard' />
        <LinkLayout to='/addCpuCoolerFan' nameLink='Add Cpu Cooler Fan' />
        <LinkLayout to='/addCpuCoolerLiquid' nameLink='Add Cpu Cooler Liquid' />
      </Layout>
    );
  }
}
